Life history. The largest specimen examined was 253.8 mm (
UW 117348
), a ripe female with yolked eggs, and the largest specimen observed was about 390 mm from off Amchitka Island in the Aleutian Islands ( AFSC 2000 survey photograph, JWO, unpublished data). The smallest ripe female with yolked eggs was 186.8 mm . Ripe yolked eggs were about 2.6 mm in diameter. The smallest ripe male was 123.9 mm ; the largest, 237 mm .
